import React from "react";
import "../css/carrusel.css";

function Carrusel() {
  return (
    <div className="contenedor-carrusel">
        <div id="carouselExampleCaptions" N="carousel slide">
            <div N="carousel-inner">
                <div N="carousel-item active">
                    <div N=""></div>
                </div>
            </div>
            <button N="carousel-control-prev" type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide="prev">
                <span N="carousel-control-prev-icon" aria-hidden="true"></span>
                <span N="visually-hidden">Previous</span>
            </button>
            <button N="carousel-control-next" type="button" data-bs-target="#carouselExampleCaptions" data-bs-slide="next">
                <span N="carousel-control-next-icon" aria-hidden="true"></span>
                <span N="visually-hidden">Next</span>
            </button>
        </div>
    </div>
  );
}

export default Carrusel;
